        for(int i=0;i<num100;i++){
           Value coin100 = new Coin100();
           sum += coin100.getValue();
        }
        return sum;
    }
}

public class B6_1{
    public static void main(String[] args)
        Coin 100 coin1 = new Coin100();
        int value = coinSum(1,2);
        System.out.println("合計 "+value+" です");
    }

    public static int coinSum(int num50,int num100){
        int sum = 0;
        for(int i=0;i<num50;i++){
           Value coin50 = new Coin50();
           sum += coin50.getValue();
        }
        for(int i=0;i<num100;i++){
           Value coin100 = new Coin100();
           sum += coin100.getValue();
        }
        return sum;
    }
}

